import React, { Component } from 'react';
import BillHeading from '../UI/molecules/main/BillHeading';
import BillItem from '../UI/organisms/main/BillItem';
import BillingSection from '../UI/organisms/billing/BillingSection';
import './billingMain.scss';

class BillingMain extends Component {
    render() {
        return (
            <section className='bill'>
                <BillHeading />
                <div className='billContainer'>
                    <BillItem />
                </div>
                <BillingSection />
            </section>
        )
    }
}

export default BillingMain
